import React from 'react';
import ReactDOM from 'react-dom';
import { Route, Link, BrowserRouter as Router, browserHistory} from 'react-router-dom'
import './index.css';
import App from './App';
import Sidebar from './superadmin/sidebar';
import * as serviceWorker from './serviceWorker';
import Homepage from './student/homepage';
import AcademicProvider from './superadmin/AcademicProvider'

const routing = (
    <Router >
        <div>
            <Route exact path="/" component={App} />

            {/* <Route path="/info" component={Sidebar} >
            <Route path="info/data" component={Homepage} /> */}
            <Route path ="/info" component={AcademicProvider}>
            </Route>
        </div>
    </Router>

)
ReactDOM.render(routing, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
